package ManishLokesh.Neptune.v1.PNRService.PnrResponse;import java.util.List;import java.util.Objects;public class PnrResponse {    private int totalStation;    private List<StationResponse> stations;    private TrainResponse trainInfo;    private SeatResponse seatInfo;    private Long pnrNumber;    public PnrResponse(int totalStation, List<StationResponse> stations,                       TrainResponse trainInfo, SeatResponse seatInfo,Long pnrNumber){        this.totalStation = totalStation;        this.stations = stations;        this.trainInfo = trainInfo;        this.seatInfo = seatInfo;        this.pnrNumber = pnrNumber;    }    public int getTotalStation() {        return totalStation;    }    public void setTotalStation(int totalStation) {        this.totalStation = totalStation;    }    public List<StationResponse> getStations() {        return stations;    }    public void setStations(List<StationResponse> stations) {        this.stations = stations;    }    public TrainResponse getTrainInfo() {        return trainInfo;    }    public void setTrainInfo(TrainResponse trainInfo) {        this.trainInfo = trainInfo;    }    public SeatResponse getSeatInfo() {        return seatInfo;    }    public void setSeatInfo(SeatResponse seatInfo) {        this.seatInfo = seatInfo;    }    public Long getPnrNumber() {        return pnrNumber;    }    public void setPnrNumber(Long pnrNumber) {        this.pnrNumber = pnrNumber;    }}